import React from 'react';

import classes from './button.module.css'

const button = (props) => {
  console.log(props)
  if (props.status) {
    console.log(`${props.status}ty troubo`) 

  }
  let text = "holahej zkouska"


  return (
  
<button type="button" className="btn" onClick={e => props.clicked(e, "valve2")}>Valve 2 {text}</button>


)};

export default button
